def this_function(s: str) -> bool:
    parts = s.split('-')
    if len(parts) < 3:
        return False
    middle = parts[1]
    try:
        num = int(middle)
    except ValueError:
        return False
    return num < 1 or num > 12

def this_function(s: str) -> bool:
    first_hyphen = s.find('-')
    if first_hyphen == -1:
        return False
    second_hyphen = s.find('-', first_hyphen + 1)
    if second_hyphen == -1:
        return False
    part = s[second_hyphen + 1:]
    try:
        num = int(part)
    except ValueError:
        return False
    return num < 1 or num > 31
